'use strict';

// VARIABLES //

var invalid;
var test;


// MAIN //

// Create our test cases:
invalid = [];

test = {
	'code': [
		'/**',
		'* [Beep][beep] [boop][beep].',
		'*',
		'* [beep]: https://beep.com',
		'* [beep]: https://boop.com',
		'*/',
		'function beep() {',
		'    console.log( "boop" );',
		'}'
	].join( '\n' ),
	'errors': [
		{
			'message': 'Do not use definitions with the same identifier (3:1)',
			'type': null
		}
	]
};
invalid.push( test );


// EXPORTS //

module.exports = invalid;
